import React from "react";

const Pagination = ({ currentPage, handlePrev, handleNext, hasMoreItems }) => (
  <div className="pagination">
    <button disabled={currentPage === 1} onClick={handlePrev}>
      Previous
    </button>
    <button disabled={!hasMoreItems} onClick={handleNext}>
      Next
    </button>
  </div>
);

export default Pagination;
